var b="url",c="06__تایید_و_ارسال_قرارداد_اعطای_نمایندگی_فروش-اشخا.html",d="generationDate",e=new Date(1755931802348.23),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="lg",s="vi",t="check",u="san",v="ba",w="loginv",x="inpa",y="page",z="packageId",A="dae7c010731040d98de57ca80e1d318f",B="type",C="Axure:Page",D="06. تایید و ارسال قرارداد اعطای نمایندگی فروش-اشخاص حقوقی(واحد فروش)",E="notes",F="annotations",G="fn",H="1",I="ownerId",J="c8ef762ad7af4a3d9a9a4752b90e06fc",K="label",L="(Text Field)",M="Note",N="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">کلیه فیلدهای دارای برچسب</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">&quot;</span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#D9001B;\">Fetch</span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">&quot;</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">قرار گرفته در باکس صورتی از فرم ایجاد قرارداد که پیش از این توسط کاربر واحد توسعه بازار مورد تایید قرار گرفته است واکشی و در فرم قرارداد جهت ثبت و ارسال به نماینده فروش به منظور تایید و امضای نماینده درج گردد</span></p>",O="2",P="67c7714579814d1c82a66eb79f129aea",Q="تایید و ارسال قراردا",R="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">در هنگام ثبت و ارسال قرارداد اعطای نمایندگی فروش جهت نماینده فروش؛ پیامکی مبنی بر اسال قرارداد با محتوای زیر،در&nbsp; خصوص افراد حقیقی به شماره موبایل فرد حقیقی، در خصوص افراد حقوقی به شماره موبایل تمامی صاحبان امضاء به صورت جداگانه و در خصوص مشارکت کننده مدنی به شماره موبایل تمامی مشارکت کنندگان مدنی ارسال گردد</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\"><br></span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">متن پیامک</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#A30014;\">جناب آقای/خانم ............. با شناسه نمایندگی ..........؛ قرارداد اعطای نمایندگی فروش شما ارسال گردید.خواهشمند است در اسرع وقت با مراجعه به سامانه فروش گیتی کالا نسبت به بررسی و تعیین وضعیت قرارداد خود اقدام نمایید</span></p><p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#A30014;\">با تشکر، واحد فروش گیتی کالا</span></p>",S="3",T="e06381fe9a364d918937ebd227609b6b",U="ghar",V="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">در صورتی که شرط چک در هنگام ایجاد قرارداد تیک زده شده باشد فیلدهای </span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#FB0000;\">مبلغ </span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">و </span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#FB0000;\">تاریخ چک </span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;\">به طور اتوماتیک واکشی و در صفحه 4 قرارداد درج گردد</span></p>",W="4",X="bc3d0452662a4c94ae500e432d32a0de",Y="بله",Z="<p><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#000080;\">مهم:</span><span style=\"font-family:'B Yekan', sans-serif;font-weight:400;color:#A30014;\"> بسته به خط مشی شرکت گیتی کالا ایرانیان اجباری بودن یا نبودن این موضوع که قرارداد پیش از ارسال به نماینده فروش مورد تایید مدیر عامل گیتی کالا قرار گیرد قابلیت پیاده سازی دارد</span></p>",ba="style",bb="baseStyle",bc="627587b6038d43cca051c114ac41ad32",bd="pageAlignment",be="center",bf="fill",bg="fillType",bh="solid",bi="color",bj=0xFFFFFFFF,bk="image",bl="imageAlignment",bm="near",bn="imageRepeat",bo="auto",bp="favicon",bq="sketchFactor",br="0",bs="colorStyle",bt="appliedColor",bu="fontName",bv="Applied Font",bw="borderWidth",bx="borderVisibility",by="borderFill",bz=0xFF797979,bA="cornerRadius",bB="cornerVisibility",bC="outerShadow",bD="on",bE=false,bF="offsetX",bG=5,bH="offsetY",bI="blurRadius",bJ="spread",bK="r",bL=0,bM="g",bN="b",bO="a",bP=0.349019607843137,bQ="adaptiveStyles",bR="interactionMap",bS="onLoad",bT="eventType"